import classes from "./ForgetPWMainFrame.module.css";

function ForgetPWMainFrame() {
    return (
        <div>
            <div>
                <input className={classes.mailInput} />
            </div>
            <button className={classes.button}>傳送驗證碼</button>
        </div>
    );
}

export default ForgetPWMainFrame;
